    mergeArrayByKey(arr) {
        const result = {};
        arr.forEach((obj) => {
            const key = Object.keys(obj)[0];
            if (result[key]) {
                result[key] = result[key].concat(obj[key]);
            } else {
                result[key] = obj[key];
            }
        });

        // Convert the result to an array of objects
        const mergedArray = Object.keys(result).map((key) => ({ [key]: result[key] }));
        return mergedArray;
    }
